<template>
	<view class="content">
		<!-- #ifdef H5 -->
			<sknavigate class="navigate" title="我的" :showBack="false" :showBackText="false"></sknavigate>
		<!-- #endif -->		
		
		<view class="top">
			<view class="avatar" v-on:click="goMyInfomation()">
				<image class="img" :src="userInfo.HeadImgUrl"></image>
				<view class="name">{{userInfo.Name}}</view>
			</view>			
		</view>
		<view>
			<uni-list class="list">
				<uni-list-item v-for="(item,index) in List" :key="index" @click.native="linkPage(item,index)" showArrow="true">
					<view class="list-item" slot="header">
						<view>{{item}}</view>
					</view>
				</uni-list-item>
				
			</uni-list>		
		
		</view>
		<loginModule ref="login" @success="loginSuccess"></loginModule>
	</view>


</template>

<script>
	
	export default {		
		data() {
			return {
				option: {
					HeadImgUrl: "../../static/img/mine/header_boy.png",
					Name: "登录",
				},
				userInfo:{},
				place: "../../static/img/mine/header_boy.png",
				list:["预约记录","测试记录","我的收藏","退出登录"],
				List:[]
				
			}
		},

		onLoad: function() {
			if(this.config.consult == true){
				this.List = this.List.concat(this.list[0])
			}
			if(this.config.evaluation == true){
				this.List = this.List.concat(this.list[1])
			}
			if(this.config.collection == true && (this.config.consult == true || this.config.science == true)){
				this.List = this.List.concat(this.list[2])
			}
			this.List = this.List.concat(this.list.slice(-1))
		},
		onShow() {
			this.navigate.clearnStack()
			//刷新数据
			if (this.user.getLoginState() == true) {
				this.userInfo = this.user.getUserData()
			}else{
				this.userInfo = this.option
			}
		},
		options: { styleIsolation: 'shared' },
		methods: {
			goMyInfomation: function() {			
				
				if (this.user.getLoginState()) {	
					this.navigate.navigateTo({
						url: '/pages/mine/system/mine_userInfo'
					})					
				} else {
					uni.showToast({
						title: "去登录",
						icon:"none"
					})
					this.navigate.navigateTo({
						url: '/pages/mine/system/login'
					})					
				}

			},
			openLogin:function(){
				this.$refs.login.showLogin()
			},
			loginSuccess:function(e){
				uni.reLaunch({
					url:"mine"
				})
			},

			linkPage: function(obj, index) {				
				let loginState = this.user.getLoginState()
				
				if (!loginState) {
					this.navigate.navigateTo({
						url: '/pages/mine/system/login'
					})					
				}else{
					let urls = ["/pages/mine/myOrder/my_order","/pages/mine/mine_evaluation","/pages/mine/mine_collection","/pages/mine/system/login"]
					if(obj == this.list[3]){
						let _this = this
						uni.showModal({
							title:"确定要退出登录么？",
							success(e) {
								if(e.confirm == true){									
									_this.user.setLoginState(false)
									_this.userInfo = _this.option
								}							
							}
						})
					}else{
						let index = this.list.indexOf(obj)
						let url = urls[index]
						this.navigate.navigateTo({
							url:url
						})						
					}
				}		
			}
		}
	}
</script>

